import styled from "styled-components";

const Container = styled.div`
  position: relative;
  width: 700px;
  margin: 0 auto;

  @media (max-width: 768px) {
    width: 100%;
  }
`

const ContainerWrap = styled.div`
  display: flex;
  flex-wrap: wrap;
  flex-direction: row;
  justify-content: center;
`

const ItemWrap = styled.div`
  display: flex;
  width: 27%;
  margin: 10px 15px;
  height: 75px;
  align-content: center;
  justify-content: center;
  align-items: center;

  @media (max-width: 640px) {
    width: 30%;
    margin: 20px 20px;
    height: 40px;
  }
`


const Header = () => (
  <Container>
    <ContainerWrap>
        <ItemWrap>
          <p>teste</p>
        </ItemWrap>
    </ContainerWrap>
  </Container>
);

export default Header;
